import { Component, Input} from '@angular/core';
import { NgModel } from '@angular/forms';

@Component({
  selector: 'app-parental-data',
  templateUrl: './parental-data.component.html',
  styleUrls: ['./parental-data.component.css']
})
export class ParentalDataComponent {
 user:string = '';
 nome:string = '';

}
<div class="aula">
    <h1>Login</h1>
    <form>
        <input type="text" [(ngModel)]="user" value="user" placeholder="Digite seu usuario">
        <input type="text" [(ngModel)]="nome" value="nome" placeholder="Digite seu nome">
    </form>


    <h3>User: {{user}}</h3>
    <p>Nome: {{nome}}</p>
